import React from 'react'
import Logo from '../../img/logo.png'
const LogoSearchComponent = () => {
  return (
    <div className='LogoSearchComponent'>
        <img src={Logo} alt="Logo">

        </img>
    </div>
  )
}

export default LogoSearchComponent
